        billingAddr: [
          { required: true, message: 'Please enter address', trigger: 'blur' },
        ],
        billingApartment: [
          { required: true, message: 'Please enter Apartment, Suite, etc', trigger: 'blur' },
        ],
        billingCity: [
          { required: true, message: 'Please enter city', trigger: 'blur' },
        ],
        billingState: [
          { required: true, message: 'Please enter state', trigger: 'blur' },
        ],
        billingZip: [
          { required: true, message: 'Please enter ZIP code', trigger: 'blur' },
        ],
      },
      url:'',
    };
  },
  methods: {
    inintYoopayJS(obj){
      this.$nextTick(() => {
        let formDom = document.getElementsByClassName('plugin'),
            {width,paddingTop,paddingBottom,paddingRight,paddingLeft,billingCountry,billingAddr,billingCity,billingState,billingZip,billingApartment,url} = obj
        for (let i = 0; i < formDom.length; i++) {
          formDom[i].style.width = `${width || 100}%`;
          formDom[i].style.paddingTop = `${paddingTop || 38}px`;
          formDom[i].style.paddingBottom = `${paddingBottom || 64}px`;
          formDom[i].style.paddingRight = `${paddingRight || 30}px`;
          formDom[i].style.paddingLeft = `${paddingLeft || 30}px`;
          this.cardInfo.billingCountry = `${billingCountry}`
          this.cardInfo.billingAddr = `${billingAddr}`
          this.cardInfo.billingCity = `${billingCity}`
          this.cardInfo.billingState = `${billingState}`
          this.cardInfo.billingZip = `${billingZip}`
          this.cardInfo.billingApartment = `${billingApartment}`
          this.url = `${url}`
        }
      })
    },

    selectPay(index,type){
      this.active = index
      this.cardType = type
      if(type === 'PayPal'){
        this.disabledForm = true
      }else{
        this.disabledForm = false
      }
    },
    infoForm(){
      let obj = {
        cardType:this.cardType,
        cardNumber:this.cardInfo.cardNumber,
        cardName:this.cardInfo.cardName,
        cardExpdateMonth:this.cardInfo.cardExpdateMonth,
        cardExpdateYear:this.cardInfo.cardExpdateYear,
        cardCvv2:this.cardInfo.cardCvv2,
        billingCountry:this.cardInfo.billingCountry,
        billingAddr:this.cardInfo.billingAddr, // 街道
        billingApartment:this.cardInfo.billingApartment, // 具体房间号
        billingCity:this.cardInfo.billingCity,// 城市
        billingState:this.cardInfo.billingState, // 州
        billingZip:this.cardInfo.billingZip // 邮编
      }
      return obj
    },
    submitForm(formName) {
      if(this.cardType === 'PayPal'){
        this.$http.post(this.url,{cardType:this.cardType}).then(res => {
          console.log(res,'============')
        })
      }else{
        this.$refs[formName].validate((valid) => {
          if(valid){
            this.$emit('validateSuccess')
            this.$http.post(this.url,this.infoForm()).then(res => {
              this.$emit('subCallback',res)
              console.log(res,'============')
            })
          } else {
            console.log('error submit!!');
            return false;
          }
        });
      }
    },
  }
}
</script>

